import React, { Component } from 'react'

export default class Header extends Component {
    render() {
        return (
            <header id="home">
                <div className="row">
                    <nav id="navbar navbar-default" className="row">

                        <ul >
                            <li><a href="#home"> Home</a></li>
                        </ul>
                    </nav>
                </div>

            </header>
        )
    }
}
